import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input, Button, Divider } from "antd";
// import { image } from "../../static/images/profile.jpeg";
// import "../../static/css/style.scss";
class SideMenuLeft extends Component {
  state = {
    isClicked: false,
  };

  render() {
    const { isClicked } = this.state;
    const { showModal } = this.props;
    return (
      <Layout className="side-menu-left-content">
        <div className="content-list">
          <div className="image-container">
            <img src="../../static/images/profile.jpeg" className="profile-image" />
            <p className="add-profile-icon">
              <span className="plus-icon" onClick={showModal}>
                <Icon className="dynamic-delete-button" type="edit" />
              </span>
            </p>
          </div>
          <p className="optionA">
            <b>
              <Link href="/about">
                <a>Home</a>
              </Link>
            </b>
          </p>
          <p className="option">
            <b>Jobs Category</b>
          </p>
          <p className="option">
            <b>Talent Category</b>
          </p>
          <p className="option">
            <b>Blogs Category</b>
          </p>
        </div>
      </Layout>
    );
  }
}

export default SideMenuLeft;
